export const IncNumber = (num)=>{
	return{
		type:"INCREMENT",
		payload:num
	}
}

export const DecNumber = ()=>{
	return{
		type:"DECREMENT"
	}
}

export const Mult = (num)=>{
	return{
		type:"MULT",
		payload:num
	}
}

export const Div = ()=>{
	return{
		type:"DIV"
	}
}
